create table havenbags_furnitures_source
(
    Id             int auto_increment
        primary key,
    TypeId         int          not null,
    ThemeId        int          not null,
    ElementId      int          not null,
    Color          int          not null,
    SkillId        int          not null,
    LayerId        int          not null,
    BlocksMovement tinyint      not null,
    IsStackable    tinyint      not null,
    CellsWidth     int unsigned not null,
    CellsHeight    int unsigned not null,
    `Order`        int unsigned not null
)
    engine = MyISAM
    charset = utf8;

